import pokemons from "../data";

function typesPokemons(type) {
  return pokemons.filter((pokemon) => pokemon.type === type);
}

function takeTypes() {
  const types = [];
  pokemons.forEach((pokemon) => {
    types.push(pokemon.type);
  });
  console.log(types);
}
takeTypes();

export default typesPokemons;
